import React, { useEffect, useState } from "react";
import axios from "axios";
import {
    MDBCard,
    MDBCardHeader,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBBtn
  } from 'mdb-react-ui-kit';  

function Viewbook(){
    const [viewapp,setViewapp] = useState([]);
    useEffect(() => {
      axios
        .get("/view_app")
        .then((response) => {
         setViewapp(response.data); 
        })
        .catch((error) => {
          console.log(error);
        });
    }, []);

    return(
     <div className="App mt-4">
        {viewapp.map((slots) => (
            <div key={slots._id}>
    <MDBCard>
      <MDBCardHeader>{slots.username}</MDBCardHeader>
      <MDBCardBody>
                  <MDBCardTitle><p>Meeting Link: {slots.meeting_url}</p></MDBCardTitle>
                  <MDBCardText><p>Meeting Password: {slots.pass}</p></MDBCardText>
                  <MDBBtn href={slots.url}>Join</MDBBtn>
                </MDBCardBody>
    </MDBCard>
    </div>
        ))}
     </div>
    );
}
export default Viewbook
